  JRUSSELL, Elizabeth Katharine and BLAKER, John
  01> RUSSELL, Elizabeth Katharine m on ** **, 1967 to BLAKER, John
  b 07.01.1936
  b ** ** ****
  Address: Stanton's Farm, East Chiltington, Near Lewes, Sussex, England.
  02> RUSSELL, John Rolleston m on 15.12.1963 to ORMOND, Phillida Ann
  b 06.06.1938
  b 03.05.1941
  John b. at Hastings and m. at St Luke's Church, Havelock North. Phillida, d/ WE W Ormond and Una
  Constance Herrick. Address: "Tunanui", RD 9, Hastings.
  John is a sheep farmer. He was Chairman of Mt Vernon Farms near Wanganui from 1974-84. He served on
  the Hereworth School Board (1985-98). He enjoys flying and was on the executive of the Hawkes Bay and
  East Coast Aero Club for 25 years, and a director of New Zealand Aerial Mapping for ten years.
  Phillida has redeveloped a fine old garden so that it can be more easily maintained and enjoys sharing
  it. i. F.
  01> RUSSELL, Andrew Hamilton
  b 02.12.1964
  Andrew was educated at Royal Agricultural College, Cirencester, England, gaining a Certificate of
  Merit in Agriculture. He farms at "Tunanui" and is a jet boat enthusiast.
  02> RUSSELL, Rachel Ann m on 06.01.1996 to SLEIGH, Michael James
  b 07.06.1967
  b 02.11.1967
  Rachel m. at St Luke's Church, Havelock North. Address: 84 Knowles Street, St Albans,
  Christchurch.
  Rachel graduated BBS and has worked in product marketing with Telecom. Michael is a lawyer with
  Chapman Tripp.
  01> SLEIGH, Charles Ralph
  b 16.01.1998
  03> RUSSELL, Sam Walcot
  b 22.09.1968
  Sam graduated DipAg from Lincoln College. He worked for a year as a cowboy in New Mexico, Arizona
  and Montana in the USA and how farms at "Tunanui". He is a finalist for the 1998 Farmer of the
  Year.
  04> RUSSELL, Daniel John
  b 27.09.1970
  Daniel was christened at Paihia at the Williams Reunion of 1973. He is a pilot with Eagle Air and
  in 1998 is sitting his captain's exam.
  03> RUSSELL, Rachel Gertrude
  b 06.10.1939
  Rachel 6. at Hastings. Address: 4 Trigon Road, London SW 8, England. Occupation: Rachel has worked for
  Christies in London for many years and is head of the antique glass department.
  05> RUSSELL, Margaret Gertrude m on 10.06.1933 to LOWRY, Thomas Coleman (Tom)
  (Margot)
  b 06.07.1906 d 13.07.1993
  b 17.02.1898 d 20.07.1976
  Margot shared Tom's enthusiasm for horses and racing and was always warmly interested in people.
  Tom was educated at Christ's College (Prefect, Captain of Cadets, captain of 1st rugby XV, captain of 1st
  cricket XI). He served in the RFC (RAF) in WW1.
